import {React, useState} from "react";


export const Dish = ({ name }) => {
  let [count, setCount] = useState(0);

  return (
    <>
      <button 
        onClick={() => {
          console.log(`Click ${name} button +`);
          setCount(count++);
        }}
      >
        +
      </button>
      <button 
        onClick={() => {
          console.log(`Click ${name} button -`);
          count0 ? setCount(count--) : count;
        }}
      >
        -
      </button>
      <div>{name}</div>
    </>
  )
};
